import React, { Component } from 'react';
import '../css/ErrorPage.css';

import Header from './Header';

class ErrorPage extends Component {
  render() {
    return (
      <div className="ErrorPage">
        this page does not exist!
      </div>
    );
  }
}

export default ErrorPage;
